const TitleText = ({ title, suptitle, suptitleSecond, variant }) => {
  return (
    <div className="title-text">
      <h1>{title}</h1>
      {
        variant === 1 ? (
          <h2>{suptitle}</h2>
        ) : (
          <h3>{suptitleSecond}</h3>
        )
      }
    </div>
  );
};

export default TitleText;
